// Default imports
import React from 'react';
import './home.css';

const Home = () => {
    return (
        // HTML here
        <div className="center-align">
            Hello, I'm <span className="blue-text">Neerav Panchal</span>.<br/>
            I'm a full-stack web developer.<br/>
            <a href='/about' className="waves-effect waves-light btn blue">Find out more.</a>
        </div>
    )
};

// Default export
export default Home;
